import styled from "styled-components";
import { Container, Grid } from "semantic-ui-react";

export const StyledLandingContainer = styled(Container)`
  &&& {
    justify-content: center;
    width: 1004px;
  }
`;

export const StyledMissionTitle = styled.h1`
  &&& {
    color: white;
    font-family: Futura;
    font-size: 150px;
    font-style: normal;
    font-weight: 700;
    line-height: 199px;
    letter-spacing: 0em;
    text-align: left;
  }
`;

export const StyledMissionStatement = styled.p`
  &&& {
    color: white;
    font-family: Avenir;
    font-size: 32px;
    font-style: normal;
    font-weight: 400;
    line-height: 44px;
    letter-spacing: 0em;
    text-align: left;
  }
`;

export const StyledTitle = styled.h2`
  &&& {
    color: white;
    font-family: Futura;
    font-size: 32px;
    font-style: normal;
    font-weight: 700;
    line-height: 43px;
    letter-spacing: 0em;
    text-align: left;
  }
`;

export const StyledDescription = styled.p`
  &&& {
    color: white;
    font-family: Avenir;
    font-size: 16px;
    font-style: normal;
    font-weight: 400;
    line-height: 22px;
    letter-spacing: 0em;
    text-align: left;
  }
`;
